def decimale(romain):
    total = 0
    longueur = len(romain)
    for i in range(longueur):
        valeur_actuelle = VALEUR[romain[i]]
        if i == longueur - 1 or VALEUR[romain[i]] >= VALEUR[romain[i + 1]]:
            total += valeur_actuelle
        else:
                total -= valeur_actuelle
        return total

